  return (
    <TwoChild 
    imgs={<img src='/images/tech-skill.jpg'></img>}
    text={
        <>
            <h2>Learn the Tech Skills of Tomorrow <span>online</span></h2>
            <p>Empower Your Career with Cutting-Edge Tech Skills" Master programming, web development, and data science with our expertly crafted courses. Stay ahead in the digital age with hands-on projects and industry-relevant tools.
            <br />
            <br />
